import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Homepage = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  return (
    <div style={{margin:'12px'}}>
      <Slider {...settings}>
        <div>hello</div>
        <div>hi</div>
        <div>yes</div>
        <div>no</div>
      </Slider>
    </div>
  );
};

export default Homepage;
